INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES (0, 105211, "素敵なケーキをありがとう！\nまさかこんな盛大に\nお祝いしてもらえるなんて\n思わなかったわ！", "", 1, 1052501, 6, 11, 1, 1052501040, 0);
