INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES (0, 105211, "おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", "", 1, 1052501, 6, 11, 1, 1052501043, 0);
INSERT INTO `v1_1976c0835ba9ed20951ad59c04f2241da848a70be9118fcd4e135d715a0fe7bd` VALUES ("", 0, "", "", "", 1052501, "", 91, "", 1052501044, "");
